	// pdf of normal distribution
	double myDnorm(double x){  
		double pGauss;
		int zIndleft;
		int zIndright;

		if(x > 0) x = -x;    // because p(x)==p(-x) is always true
		if(x < Z_LUT_lowHalf[0][0]) x = Z_LUT_lowHalf[0][0];
		zIndleft = (int)Math.floor(((x-Z_LUT_lowHalf[0][0]) / 0.01));
		if(x == Z_LUT_lowHalf[0][zIndleft]){    // If x is JUST a z value in the table
			pGauss = Z_LUT_lowHalf[1][zIndleft];
		}else{
			zIndright = zIndleft + 1;
			pGauss = (x - Z_LUT_lowHalf[0][zIndleft]) / 0.01;
			pGauss = Z_LUT_lowHalf[1][zIndleft] + pGauss * (Z_LUT_lowHalf[1][zIndright]-Z_LUT_lowHalf[1][zIndleft]);
		}
		return pGauss;
	}


	// cdf of normal distribution
	double myPnorm(double x){ 
		double pGauss;
		int zIndleft;
		int zIndright;

		double x_forCal = x;
		if(x>0) x_forCal = -x;
		if(x_forCal < Z_LUT_lowHalf[0][0]) x_forCal = Z_LUT_lowHalf[0][0];
		zIndleft = (int)Math.floor(((x_forCal-Z_LUT_lowHalf[0][0]) / 0.01));

		if(x_forCal == Z_LUT_lowHalf[0][zIndleft]){    // If x is JUST a z value in the table
			pGauss = Z_LUT_lowHalf[2][zIndleft];
		}else{
			zIndright = zIndleft + 1;
			pGauss = (x - Z_LUT_lowHalf[0][zIndleft]) / 0.01;
			pGauss = Z_LUT_lowHalf[2][zIndleft] + pGauss * (Z_LUT_lowHalf[2][zIndright]-Z_LUT_lowHalf[2][zIndleft]);
		}
		if(x>0){
			pGauss = 1 - pGauss;
		}
		return pGauss;
	}


	// Inverse cdf of normal distribution
	double myQnorm(double cumProb){

		if(cumProb<0 || cumProb>1){
			//			System.out.println("Error in calculating qnorm: input out of leagal range.");
			return -10000;
		}

		double quantileGauss = 0.0;
		double cumProb_forCal = cumProb;

		if(cumProb > 0.5) cumProb_forCal = 1- cumProb;

		// First find the index of cumProb in Z_LUT_lowHalf[2] (cdf), then return Z_LUT_lowHalf[0][foundInd]
		int leftInd = 0;
		int rightInd = Z_LUT_lowHalf[2].length - 1;
		int midInd = 0;
		double midCdfVal = 0.0;
		if(cumProb_forCal <= Z_LUT_lowHalf[2][leftInd]){
			quantileGauss = Z_LUT_lowHalf[0][leftInd];

		}else if(cumProb_forCal == Z_LUT_lowHalf[2][rightInd]){
			quantileGauss = Z_LUT_lowHalf[0][rightInd];

		}else{ 		 // if the cdf value is in the table Z_LUT_lowHalf
			while( (rightInd - leftInd) > 1){
				midInd = (int)Math.round((leftInd + rightInd) / 2);
				midCdfVal = Z_LUT_lowHalf[2][midInd];
				if(cumProb_forCal == midCdfVal){
					quantileGauss = Z_LUT_lowHalf[0][midInd];
					break;
				}else if(cumProb_forCal > midCdfVal){
					leftInd = midInd;
				}else{
					rightInd = midInd;
				}
			}
			quantileGauss = (cumProb_forCal - Z_LUT_lowHalf[2][leftInd]) / (Z_LUT_lowHalf[2][rightInd] - Z_LUT_lowHalf[2][leftInd]);   // interpolation fraction
			quantileGauss = Z_LUT_lowHalf[0][leftInd] + quantileGauss*0.01;
		}

		if(cumProb <= 0.5){
			return quantileGauss;
		}else{
			return -quantileGauss;
		}
	}


